<p><strong>Creational Patterns</strong></p>
<ul>
<li>
<p>separates a system from the  creation, composition and  representation of its objects ,  which increases the system's  flexibility in what, who, how, and  when of object creation.</p>
<p>它将系统与其对象的创建、组合和表示分离开来，从而提高了系统在对象创建的内容、对象创建者、创建方式和创建时间方面的灵活性。</p>
</li>
<li>
<p>encapsulates the knowledge about  which classes a system uses and  hides the details of how the  instances of these classes are  created and structured.</p>
